export class IBaseStorage {
    constructor(logger, keyValueStorage, config) {
        this.logger = logger;
        this.keyValueStorage = keyValueStorage;
        this.config = config;
    }
}
export class IRelayerStorage extends IBaseStorage {
    constructor(logger, keyValueStorage, config) {
        super(logger, keyValueStorage, config);
        this.logger = logger;
        this.keyValueStorage = keyValueStorage;
        this.config = config;
    }
}
export class IStorage extends IRelayerStorage {
    constructor(logger, keyValueStorage, config) {
        super(logger, keyValueStorage, config);
        this.logger = logger;
        this.keyValueStorage = keyValueStorage;
        this.config = config;
    }
}
